'use client';

import { useState } from 'react';
import { useApp } from '@/context/AppContext';
import { type Office, getInvestmentStatus } from '@/data/offices';
import { getResponseCurvesForOffice } from '@/data/response-curves';
import { MapPin, ArrowRight, ShieldCheck } from 'lucide-react';

function formatDollar(val: number): string {
    if (Math.abs(val) >= 1000) return `$${(val / 1000).toFixed(1)}K`;
    return `$${val.toLocaleString()}`;
}

const channelColors: Record<string, string> = {
    Google_Search: 'var(--channel-google)',
    Meta: 'var(--channel-meta)',
    Google_Programmatic: 'var(--channel-programmatic)',
};

const channelLabels: Record<string, string> = {
    Google_Search: 'Google',
    Meta: 'Meta',
    Google_Programmatic: 'Prog.',
};

function OfficeCard({ office }: { office: Office }) {
    const { selectOffice } = useApp();
    const status = getInvestmentStatus(office);
    const curves = getResponseCurvesForOffice(office.officeId);

    const totalCurrent = curves.reduce((s, c) => s + c.currentSpend, 0);
    const totalRecommended = curves.reduce((s, c) => s + c.optimalSpend, 0);

    return (
        <div className={`office-card ${status}`} onClick={() => selectOffice(office.officeId)}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', marginBottom: 12 }}>
                <div>
                    <div className="office-card-name" style={{ fontSize: 20, display: 'flex', alignItems: 'center', gap: 6, marginBottom: 4 }}>
                        <ShieldCheck size={20} color={status === 'optimal' ? 'var(--success)' : status === 'under-invested' ? 'var(--heartland-blue)' : 'var(--warning)'} />
                        {office.officeName}
                    </div>
                    <div className="office-card-meta" style={{ display: 'flex', alignItems: 'center', gap: 4, marginBottom: 0, fontSize: 13, color: 'var(--medium-gray)' }}>
                        <MapPin size={14} />
                        {office.city}, {office.state} · {office.marketSize}
                    </div>
                </div>
            </div>

            {/* Core Metrics: large text to fill space */}
            <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: 16, marginBottom: 20 }}>
                <div>
                    <div className="sidebar-section-label" style={{ fontSize: 11, marginBottom: 4, color: 'var(--medium-gray)' }}>TOTAL CURRENT</div>
                    <div style={{ fontSize: 26, fontWeight: 800, color: 'var(--charcoal)', letterSpacing: '-0.03em' }}>
                        {formatDollar(totalCurrent)}
                        <span style={{ fontSize: 14, color: 'var(--medium-gray)', fontWeight: 500, marginLeft: 4 }}>/wk</span>
                    </div>
                </div>

                <div>
                    <div className="sidebar-section-label" style={{ fontSize: 11, marginBottom: 4, color: 'var(--medium-gray)' }}>CAPACITY UTIL.</div>
                    <div style={{ display: 'flex', alignItems: 'center', gap: 8 }}>
                        <div style={{ fontSize: 26, fontWeight: 800, color: 'var(--charcoal)', letterSpacing: '-0.03em' }}>{Math.round(office.capacityUtilBaseline * 100)}%</div>
                        <div className="capacity-bar" style={{ width: '100%', maxWidth: 70, height: 6 }}>
                            <div
                                className={`capacity-bar-fill ${office.capacityUtilBaseline >= 0.80 ? 'high' : office.capacityUtilBaseline >= 0.67 ? 'medium' : 'low'}`}
                                style={{ width: `${Math.round(office.capacityUtilBaseline * 100)}%` }}
                            />
                        </div>
                    </div>
                </div>
            </div>

            {/* Channels */}
            <div style={{ background: 'var(--bg-surface)', padding: '12px 16px', borderRadius: 'var(--radius-md)', marginBottom: 20 }}>
                <div style={{ fontSize: 11, fontWeight: 600, color: 'var(--medium-gray)', marginBottom: 8, letterSpacing: '0.04em' }}>SPEND ALLOCATION</div>
                {curves.map(c => {
                    const delta = c.optimalSpend - c.currentSpend;
                    return (
                        <div key={c.channel} style={{ display: 'flex', alignItems: 'center', justifyContent: 'space-between', marginBottom: 6, fontSize: 13 }}>
                            <div style={{ display: 'flex', alignItems: 'center', gap: 8 }}>
                                <span className="channel-dot" style={{ background: channelColors[c.channel], width: 8, height: 8 }} />
                                <span style={{ fontWeight: 600, color: 'var(--charcoal)' }}>{channelLabels[c.channel]}</span>
                            </div>
                            <div style={{ display: 'flex', alignItems: 'center', gap: 12, fontFamily: 'var(--font-mono)' }}>
                                <span>{formatDollar(c.currentSpend)}</span>
                                <ArrowRight size={14} color="var(--medium-gray)" />
                                <span style={{ color: delta > 0 ? 'var(--success)' : delta < 0 ? '#b8860b' : 'var(--medium-gray)' }}>
                                    {formatDollar(c.optimalSpend)}
                                </span>
                            </div>
                        </div>
                    );
                })}
            </div>

            {/* Animated hover element */}
            <div className="card-hover-animation" />
        </div>
    );
}

export default function OfficeCardGrid() {
    const { filteredOffices } = useApp();
    const [isExpanded, setIsExpanded] = useState(false);

    const visibleOffices = isExpanded ? filteredOffices : filteredOffices.slice(0, 3);

    return (
        <div style={{ display: 'flex', flexDirection: 'column', gap: 24, paddingBottom: 24 }}>
            <div className="office-grid tour-office-grid">
                {visibleOffices.map(office => (
                    <OfficeCard key={office.officeId} office={office} />
                ))}
            </div>
            {filteredOffices.length > 3 && (
                <button
                    onClick={() => setIsExpanded(!isExpanded)}
                    style={{
                        alignSelf: 'center',
                        padding: '12px 24px',
                        borderRadius: 'var(--radius-full)',
                        background: 'transparent',
                        border: '2px solid var(--border-light)',
                        color: 'var(--charcoal)',
                        fontWeight: 600,
                        cursor: 'pointer',
                        fontSize: 14,
                        transition: 'all 0.2s ease',
                    }}
                    onMouseOver={(e) => {
                        e.currentTarget.style.borderColor = 'var(--heartland-blue)';
                        e.currentTarget.style.color = 'var(--heartland-blue)';
                    }}
                    onMouseOut={(e) => {
                        e.currentTarget.style.borderColor = 'var(--border-light)';
                        e.currentTarget.style.color = 'var(--charcoal)';
                    }}
                >
                    {isExpanded ? 'Show Less Offices' : `Show ${filteredOffices.length - 3} More Offices`}
                </button>
            )}
        </div>
    );
}

'use client';

import { useState } from 'react';
import { useApp } from '@/context/AppContext';
import RecommendationCard from './RecommendationCard';

type SortField = 'officeName' | 'channel' | 'action' | 'currentSpend' | 'recommendedSpend' | 'delta' | 'confidence' | 'status';
type QueueFilter = 'all' | 'pending' | 'approved' | 'rejected';

export default function RecommendationsQueue() {
    const { recommendations, bulkApprove, bulkReject } = useApp();
    const [sortField, setSortField] = useState<SortField>('officeName');
    const [sortAsc, setSortAsc] = useState(true);
    const [filter, setFilter] = useState<QueueFilter>('all');
    const [showModal, setShowModal] = useState<'approve' | 'reject' | null>(null);

    const filtered = recommendations.filter(r => {
        if (filter === 'all') return true;
        return r.status === filter;
    });

    const sorted = [...filtered].sort((a, b) => {
        let cmp = 0;
        const aVal = a[sortField];
        const bVal = b[sortField];
        if (typeof aVal === 'string' && typeof bVal === 'string') cmp = aVal.localeCompare(bVal);
        else if (typeof aVal === 'number' && typeof bVal === 'number') cmp = aVal - bVal;
        return sortAsc ? cmp : -cmp;
    });

    const pendingCount = recommendations.filter(r => r.status === 'pending').length;

    return (
        <div>
            <div className="queue-filters">
                {(['all', 'pending', 'approved', 'rejected'] as QueueFilter[]).map(f => (
                    <button
                        key={f}
                        className={`status-filter-chip ${filter === f ? 'active' : ''}`}
                        onClick={() => setFilter(f)}
                    >
                        {f.charAt(0).toUpperCase() + f.slice(1)}
                    </button>
                ))}
                <div style={{ flex: 1 }} />
                {pendingCount > 0 && (
                    <>
                        <button className="btn btn-approve btn-xs" onClick={() => setShowModal('approve')}>
                            Approve All Pending ({pendingCount})
                        </button>
                        <button className="btn btn-reject btn-xs" onClick={() => setShowModal('reject')}>
                            Reject All Pending
                        </button>
                    </>
                )}
            </div>

            <div className="rec-grid">
                {sorted.map(r => (
                    <RecommendationCard key={r.recId} recommendation={r} />
                ))}
            </div>

            {sorted.length === 0 && (
                <div style={{ textAlign: 'center', padding: 40, color: 'var(--medium-gray)' }}>
                    <div style={{ fontSize: 28, marginBottom: 8 }}>✓</div>
                    <div style={{ fontSize: 14, fontWeight: 600 }}>All caught up</div>
                    <div style={{ fontSize: 12 }}>No {filter === 'all' ? '' : filter + ' '}recommendations to display.</div>
                </div>
            )}

            {showModal && (
                <div className="modal-overlay" onClick={() => setShowModal(null)}>
                    <div className="modal-content" onClick={e => e.stopPropagation()}>
                        <div className="modal-title">
                            {showModal === 'approve' ? 'Approve All Pending?' : 'Reject All Pending?'}
                        </div>
                        <div className="modal-body">
                            {showModal === 'approve'
                                ? `This will approve ${pendingCount} pending recommendation(s). Dashboard will update to reflect new allocations.`
                                : `This will reject ${pendingCount} pending recommendation(s). Current spend allocations will remain unchanged.`
                            }
                        </div>
                        <div className="modal-actions">
                            <button className="btn btn-modify btn-sm" onClick={() => setShowModal(null)}>Cancel</button>
                            <button
                                className={`btn ${showModal === 'approve' ? 'btn-approve' : 'btn-reject'} btn-sm`}
                                onClick={() => {
                                    if (showModal === 'approve') bulkApprove();
                                    else bulkReject();
                                    setShowModal(null);
                                }}
                            >
                                {showModal === 'approve' ? 'Approve All' : 'Reject All'}
                            </button>
                        </div>
                    </div>
                </div>
            )}
        </div>
    );
}

'use client';

import { useMemo, useState } from 'react';
import {
    Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer,
    ReferenceLine, ReferenceDot, Area, ComposedChart,
} from 'recharts';
import { Info } from 'lucide-react';
import { getResponseCurvesForOffice, hillFunction } from '@/data/response-curves';

interface Props {
    officeId: number;
}

const channelConfig: Record<string, { color: string; label: string }> = {
    Google_Search: { color: '#0074B0', label: 'Google Search' },
    Meta: { color: '#9B51E0', label: 'Meta' },
    Google_Programmatic: { color: '#00D084', label: 'Programmatic' },
};

const CustomDot = (props: { cx?: number; cy?: number; fill?: string; stroke?: string; strokeWidth?: number; r?: number; desc?: string }) => {
    const { cx, cy, fill, stroke, strokeWidth, r, desc } = props;
    if (cx == null || cy == null) return null;
    return (
        <g style={{ pointerEvents: 'auto' }}>
            <circle cx={cx} cy={cy} r={r} fill={fill} stroke={stroke} strokeWidth={strokeWidth} style={{ outline: 'none', cursor: 'pointer' }} />
            <title>{desc}</title>
        </g>
    );
};

const LegendTooltip = ({ text, dotClass, description }: { text: string; dotClass: string; description: string }) => {
    const [show, setShow] = useState(false);
    return (
        <span
            className="spend-legend-item"
            style={{ cursor: 'help', position: 'relative', display: 'inline-flex', alignItems: 'center', gap: 6 }}
            onMouseEnter={() => setShow(true)}
            onMouseLeave={() => setShow(false)}
        >
            <span className={`spend-legend-dot ${dotClass}`} />
            {text}
            <Info size={14} style={{ opacity: 0.6, marginLeft: 2 }} />
            {show && (
                <div style={{
                    position: 'absolute',
                    top: 'calc(100% + 10px)',
                    left: '50%',
                    transform: 'translateX(-50%)',
                    background: 'var(--bg-surface)',
                    border: '1px solid var(--border-gray)',
                    borderRadius: 8,
                    padding: '10px 14px',
                    fontSize: 12,
                    lineHeight: 1.5,
                    color: 'var(--charcoal)',
                    width: 280,
                    boxShadow: 'var(--shadow-lg)',
                    zIndex: 9999,
                    pointerEvents: 'none',
                    whiteSpace: 'normal',
                    animation: 'fadeIn 0.15s ease-out',
                }}>
                    <div style={{
                        position: 'absolute',
                        top: -6,
                        left: '50%',
                        transform: 'translateX(-50%) rotate(45deg)',
                        width: 10,
                        height: 10,
                        background: 'var(--bg-surface)',
                        borderLeft: '1px solid var(--border-gray)',
                        borderTop: '1px solid var(--border-gray)',
                    }} />
                    {description}
                </div>
            )}
        </span>
    );
};

export default function ResponseCurveChart({ officeId }: Props) {
    const curves = getResponseCurvesForOffice(officeId);
    const [activeChannels, setActiveChannels] = useState<Set<string>>(
        new Set(curves.map(c => c.channel))
    );

    const toggleChannel = (ch: string) => {
        setActiveChannels(prev => {
            const next = new Set(prev);
            if (next.has(ch)) {
                if (next.size > 1) next.delete(ch); // keep at least one
            } else {
                next.add(ch);
            }
            return next;
        });
    };

    // Generate merged data points for all channels
    const { chartData, spendTicks } = useMemo(() => {
        const maxSpend = Math.max(...curves.map(c => c.maxSpend));
        const steps = 150;
        const data: Record<string, number | string>[] = [];
        for (let i = 0; i <= steps; i++) {
            const spend = Math.round((maxSpend / steps) * i);
            const point: Record<string, number | string> = { spend };
            for (const c of curves) {
                point[c.channel] = Number(hillFunction(spend, c.K, c.beta, c.n).toFixed(2));
            }
            data.push(point);
        }
        // Generate tick marks at every $1K
        const ticks: number[] = [];
        for (let v = 0; v <= maxSpend; v += 1000) {
            ticks.push(v);
        }
        return { chartData: data, spendTicks: ticks };
    }, [curves]);

    const maxBookings = Math.max(...curves.map(c => c.K)) * 1.05;

    const formatSpend = (val: number) => {
        if (val >= 1000) return `$${(val / 1000).toFixed(0)}K`;
        return `$${val}`;
    };

    const formatSpendFull = (val: number) => {
        return `$${val.toLocaleString()}`;
    };

    const activeCurves = curves.filter(c => activeChannels.has(c.channel));

    return (
        <div className="chart-section">
            <div className="chart-section-title">MMM Response Curves — Incremental Bookings vs. Weekly Spend</div>

            <div className="channel-toggles">
                {curves.map(c => {
                    const cfg = channelConfig[c.channel];
                    const active = activeChannels.has(c.channel);
                    return (
                        <button
                            key={c.channel}
                            className={`channel-toggle ${active ? 'active' : ''}`}
                            style={{ color: cfg.color, borderColor: active ? cfg.color : undefined }}
                            onClick={() => toggleChannel(c.channel)}
                        >
                            <span className="channel-dot" style={{ background: cfg.color }} />
                            {cfg.label}
                        </button>
                    );
                })}
            </div>

            <ResponsiveContainer width="100%" height={280}>
                <ComposedChart data={chartData} margin={{ top: 10, right: 20, bottom: 10, left: 10 }}>
                    <CartesianGrid strokeDasharray="3 3" stroke="var(--border-gray)" />
                    <XAxis
                        dataKey="spend"
                        type="number"
                        domain={[0, 'dataMax']}
                        ticks={spendTicks}
                        tickFormatter={formatSpend}
                        tick={{ fontSize: 9, fontFamily: 'JetBrains Mono, monospace', fill: 'var(--medium-gray)' }}
                        axisLine={{ stroke: 'var(--border-gray)' }}
                    />
                    <YAxis
                        domain={[0, maxBookings]}
                        tick={{ fontSize: 9, fontFamily: 'JetBrains Mono, monospace', fill: 'var(--medium-gray)' }}
                        axisLine={{ stroke: 'var(--border-gray)' }}
                        label={{ value: 'Incremental Bookings', angle: -90, position: 'insideLeft', style: { fontSize: 9, fill: 'var(--medium-gray)' } }}
                    />

                    <Tooltip
                        contentStyle={{
                            background: 'var(--bg-surface)',
                            border: '1px solid var(--border-gray)',
                            borderRadius: 8,
                            boxShadow: '0 4px 16px rgba(0,0,0,0.12)',
                            fontFamily: 'JetBrains Mono, monospace',
                            fontSize: 11,
                        }}
                        itemStyle={{ color: 'var(--charcoal)' }}
                        labelStyle={{ color: 'var(--charcoal)' }}
                        // eslint-disable-next-line @typescript-eslint/no-explicit-any
                        formatter={(value: string | number, name: string | number) => {
                            const cfg = channelConfig[String(name)];
                            return [Number(value).toFixed(1) + ' bookings', cfg?.label || String(name)];
                        }}
                        labelFormatter={(label) => `Spend: ${formatSpend(Number(label))}`}
                    />

                    {curves.map(c => {
                        const cfg = channelConfig[c.channel];
                        if (!activeChannels.has(c.channel)) return null;
                        return (
                            <Area
                                key={`area-${c.channel}`}
                                type="monotone"
                                dataKey={c.channel}
                                stroke="none"
                                fill={cfg.color}
                                fillOpacity={0.06}
                                tooltipType="none"
                            />
                        );
                    })}

                    {curves.map(c => {
                        const cfg = channelConfig[c.channel];
                        if (!activeChannels.has(c.channel)) return null;
                        return (
                            <Line
                                key={c.channel}
                                type="monotone"
                                dataKey={c.channel}
                                stroke={cfg.color}
                                strokeWidth={2.5}
                                dot={false}
                                activeDot={{ r: 4 }}
                            />
                        );
                    })}

                    {/* Current spend vertical reference lines */}
                    {curves.map(c => {
                        if (!activeChannels.has(c.channel)) return null;
                        const cfg = channelConfig[c.channel];
                        return (
                            <ReferenceLine
                                key={`cur-line-${c.channel}`}
                                x={c.currentSpend}
                                stroke={cfg.color}
                                strokeDasharray="4 4"
                                strokeOpacity={0.5}
                                strokeWidth={1}
                            />
                        );
                    })}

                    {/* Optimal spend vertical reference lines */}
                    {curves.map(c => {
                        if (!activeChannels.has(c.channel)) return null;
                        return (
                            <ReferenceLine
                                key={`opt-line-${c.channel}`}
                                x={c.optimalSpend}
                                stroke="#10B981"
                                strokeDasharray="6 3"
                                strokeOpacity={0.4}
                                strokeWidth={1}
                            />
                        );
                    })}

                    {/* Current spend markers */}
                    {curves.map(c => {
                        if (!activeChannels.has(c.channel)) return null;
                        const cfg = channelConfig[c.channel];
                        const y = hillFunction(c.currentSpend, c.K, c.beta, c.n);
                        return (
                            <ReferenceDot
                                key={`cur-${c.channel}`}
                                x={c.currentSpend}
                                y={Number(y.toFixed(2))}
                                shape={(props: any) => (
                                    <CustomDot
                                        {...props}
                                        fill={cfg.color}
                                        stroke="var(--bg-surface)"
                                        strokeWidth={2.5}
                                        r={7}
                                        desc={`Current Spend for ${cfg.label}: $${c.currentSpend.toLocaleString()}/wk`}
                                    />
                                )}
                            />
                        );
                    })}

                    {/* Optimal spend markers */}
                    {curves.map(c => {
                        if (!activeChannels.has(c.channel)) return null;
                        const cfg = channelConfig[c.channel];
                        const y = hillFunction(c.optimalSpend, c.K, c.beta, c.n);
                        return (
                            <ReferenceDot
                                key={`opt-${c.channel}`}
                                x={c.optimalSpend}
                                y={Number(y.toFixed(2))}
                                shape={(props: any) => (
                                    <CustomDot
                                        {...props}
                                        fill="#10B981"
                                        stroke="var(--bg-surface)"
                                        strokeWidth={2.5}
                                        r={7}
                                        desc={`Recommended Spend for ${cfg.label}: $${c.optimalSpend.toLocaleString()}/wk`}
                                    />
                                )}
                            />
                        );
                    })}
                </ComposedChart>
            </ResponsiveContainer>

            {/* Spend comparison panel */}
            <div className="spend-comparison-panel">
                <div className="spend-comparison-legend">
                    <LegendTooltip text="Recommended Spend" dotClass="spend-legend-recommended" description="The green dots on the response curve show the AI-recommended optimal weekly spend. Shifting budget to this level is projected to maximize incremental bookings." />
                </div>
                <div className="spend-comparison-cards">
                    {activeCurves.map(c => {
                        const cfg = channelConfig[c.channel];
                        const delta = c.optimalSpend - c.currentSpend;
                        const deltaPct = ((delta / c.currentSpend) * 100).toFixed(0);
                        const currentBookings = hillFunction(c.currentSpend, c.K, c.beta, c.n);
                        const optimalBookings = hillFunction(c.optimalSpend, c.K, c.beta, c.n);
                        const bookingsDelta = optimalBookings - currentBookings;
                        return (
                            <div key={c.channel} className="spend-compare-card" style={{ borderLeftColor: cfg.color }}>
                                <div className="spend-compare-channel">{cfg.label}</div>
                                <div className="spend-compare-row">
                                    <div className="spend-compare-col">
                                        <div className="spend-compare-label">Current</div>
                                        <div className="spend-compare-value" style={{ color: cfg.color }}>
                                            {formatSpendFull(c.currentSpend)}<span className="spend-compare-unit">/wk</span>
                                        </div>
                                        <div className="spend-compare-bookings">{currentBookings.toFixed(1)} bookings</div>
                                    </div>
                                    <div className="spend-compare-arrow">
                                        {delta > 0 ? '→' : delta < 0 ? '→' : '='}
                                    </div>
                                    <div className="spend-compare-col">
                                        <div className="spend-compare-label">Recommended</div>
                                        <div className="spend-compare-value" style={{ color: '#10B981' }}>
                                            {formatSpendFull(c.optimalSpend)}<span className="spend-compare-unit">/wk</span>
                                        </div>
                                        <div className="spend-compare-bookings">{optimalBookings.toFixed(1)} bookings</div>
                                    </div>
                                    <div className={`spend-compare-delta ${delta > 0 ? 'positive' : delta < 0 ? 'negative' : 'neutral'}`}>
                                        <span className="spend-delta-amount">
                                            {delta >= 0 ? '+' : ''}{formatSpendFull(delta)}
                                        </span>
                                        <span className="spend-delta-pct">
                                            ({delta >= 0 ? '+' : ''}{deltaPct}%)
                                        </span>
                                        <span className="spend-delta-bookings">
                                            {bookingsDelta >= 0 ? '+' : ''}{bookingsDelta.toFixed(1)} bookings
                                        </span>
                                    </div>
                                </div>
                            </div>
                        );
                    })}
                </div>
            </div>
        </div>
    );
}
